# Voznesenka, Buzdyaksky District, Republic of Bashkortostan

}}
Voznesenka () is a rural locality (a village) in Gafuriysky Selsoviet, Buzdyaksky District, Bashkortostan, Russia. The population was 181 in 2010. There are three streets.
Geography
Voznesenka is located  south of Buzdyak (the district's administrative centre) by road. Buzdyak is the nearest rural locality.
